/**
 * @title MyDEX
 * @author (Your Name)
 * @notice A minimal, insecure AMM to be used for MEV testing.
 * This is NOT secure for production. It is missing slippage
 * and deadline protection, which makes it vulnerable to sandwich attacks.
 */
contract MyDEX is ReentrancyGuard, Ownable {
    IERC20 public tokenA;
    IERC20 public tokenB;

    uint256 public reserveA;
    uint256 public reserveB;

    /**
     * @notice Constructor
     * @param _tokenA The address of the first ERC20 token
     * @param _tokenB The address of the second ERC20 token
     */
    constructor(address _tokenA, address _tokenB) Ownable(msg.sender) {
        tokenA = IERC20(_tokenA);
        tokenB = IERC20(_tokenB);
    }

    /**
     * @notice Adds liquidity to the pool.
     * @dev This is a simple version. A real one would calculate ratios.
     */
    function addLiquidity(uint256 _amountA, uint256 _amountB) external nonReentrant {
        // --- CHECKS ---
        require(_amountA > 0 && _amountB > 0, "Amounts must be > 0");

        // --- EFFECTS ---
        reserveA += _amountA;
        reserveB += _amountB;

        // --- INTERACTIONS ---
        // Pull tokens from the user into this contract
        tokenA.transferFrom(msg.sender, address(this), _amountA);
        tokenB.transferFrom(msg.sender, address(this), _amountB);
    }

    /**
     * @notice Swaps Token A for Token B
     * @dev This is the function vulnerable to sandwich/front-run attacks.
     * It uses the x*y=k formula.
     */
    function swapTokenAForTokenB(uint256 _amountInA) external nonReentrant {
        // --- CHECKS ---
        require(_amountInA > 0, "Amount must be > 0");
        require(reserveA > 0 && reserveB > 0, "No liquidity");

        // --- CALCULATIONS (using x*y=k) ---
        // 1. Calculate the constant product (k)
        uint256 k = reserveA * reserveB;

        // 2. Add the user's input tokens to the reserve
        uint256 newReserveA = reserveA + _amountInA;

        // 3. Calculate the new reserve for Token B
        // newReserveB = k / newReserveA
        uint256 newReserveB = k / newReserveA;

        // 4. This is the amount of Token B to send to the user
        uint256 amountOutB = reserveB - newReserveB;
        require(amountOutB > 0, "Not enough output");

        // --- EFFECTS ---
        // Update reserves *before* transferring (Checks-Effects-Interactions)
        reserveA = newReserveA;
        reserveB = newReserveB;

        // --- INTERACTIONS ---
        // 1. Pull Token A from the user
        tokenA.transferFrom(msg.sender, address(this), _amountInA);
        
        // 2. Send Token B to the user
        tokenB.transfer(msg.sender, amountOutB);
    }
    
    // --- Admin Function ---
    // In case tokens get stuck
    function emergencyWithdraw(IERC20 _token) external onlyOwner {
        _token.transfer(msg.sender, _token.balanceOf(address(this)));
    }
}

